import React from 'react';
import { motion } from 'framer-motion';

const Home = () => {
  return (
    <motion.div initial={{ opacity: 0 }} animate={{ opacity: 1 }} transition={{ duration: 1 }}>
      <h1>Welcome to Simply Clone</h1>
      <p>This is a simple clone of the provided website.</p>
    </motion.div>
  );
};

export default Home;
